import React, { useState, useEffect } from 'react';

const AIRecommendations = ({ weatherData, isGenerating, onGenerate }) => {
  const [recommendations, setRecommendations] = useState(null);

  const generateRecommendations = () => {
    onGenerate();
    
    // Simulate AI recommendation generation based on weather
    setTimeout(() => {
      const temp = weatherData.temperature;
      const condition = weatherData.condition.toLowerCase();
      
      let foodRecs, clothingRecs;
      
      // Generate food recommendations based on temperature and weather
      if (temp < 15) {
        foodRecs = ['Hot Soup', 'Masala Chai', 'Biryani', 'Hot Coffee'];
      } else if (temp < 25) {
        foodRecs = ['Fresh Juice', 'Salad', 'Fruit Bowl', 'Iced Tea'];
      } else {
        foodRecs = ['Ice Cream', 'Cold Drinks', 'Watermelon', 'Coconut Water'];
      }
      
      // Generate clothing recommendations
      if (temp < 15) {
        clothingRecs = ['Heavy Jacket', 'Sweater', 'Long Pants', 'Boots'];
      } else if (temp < 25) {
        clothingRecs = ['Light Jacket', 'T-Shirt', 'Jeans', 'Sneakers'];
      } else {
        clothingRecs = ['Shorts', 'Tank Top', 'Sandals', 'Hat'];
      }
      
      // Add weather-specific recommendations
      if (condition.includes('rain')) {
        clothingRecs.push('Umbrella', 'Raincoat');
      }
      if (condition.includes('sun') || condition.includes('clear')) {
        clothingRecs.push('Sunglasses', 'Sunscreen');
      }
      
      setRecommendations({
        food: foodRecs.slice(0, 3),
        clothing: clothingRecs.slice(0, 4)
      });
    }, 3000);
  };

  useEffect(() => {
    // Auto-generate recommendations on component mount
    generateRecommendations();
  }, [weatherData.location]);

  return (
    <div className="brutal-container">
      <div 
        style={{ 
          background: isGenerating ? '#ffd700' : '#32cd32',
          padding: '20px',
          textAlign: 'center',
          border: 'none',
          borderBottom: recommendations && !isGenerating ? '4px solid black' : 'none',
          cursor: 'pointer'
        }}
        onClick={generateRecommendations}
      >
        <div className="brutal-text-lg" style={{ color: 'black' }}>
          {isGenerating ? 'GENERATING AI RECOMMENDATIONS...' : '🤖 AI RECOMMENDATIONS'}
        </div>
        {isGenerating && (
          <div style={{ marginTop: '10px', fontSize: '14px' }}>
            Analyzing weather for {weatherData.location}...
          </div>
        )}
      </div>
      
      {recommendations && !isGenerating && (
        <div style={{ padding: '20px' }}>
          {/* Food Recommendations */}
          <div style={{ marginBottom: '24px' }}>
            <h3 className="brutal-text-md" style={{ marginBottom: '12px', color: '#ff69b4' }}>
              🍽️ FOOD RECOMMENDATIONS
            </h3>
            <div style={{ display: 'flex', flexWrap: 'wrap', gap: '8px' }}>
              {recommendations.food.map((food, index) => (
                <div
                  key={index}
                  style={{
                    background: '#ff69b4',
                    color: 'white',
                    padding: '8px 12px',
                    border: '3px solid black',
                    fontSize: '14px',
                    fontWeight: '900',
                    textTransform: 'uppercase'
                  }}
                >
                  {food}
                </div>
              ))}
            </div>
            <p style={{ fontSize: '12px', marginTop: '8px', color: '#666' }}>
              Perfect for {weatherData.temperature}°C weather in {weatherData.location}
            </p>
          </div>

          {/* Clothing Recommendations */}
          <div>
            <h3 className="brutal-text-md" style={{ marginBottom: '12px', color: '#4169e1' }}>
              👕 CLOTHING RECOMMENDATIONS
            </h3>
            <div style={{ display: 'flex', flexWrap: 'wrap', gap: '8px' }}>
              {recommendations.clothing.map((clothing, index) => (
                <div
                  key={index}
                  style={{
                    background: '#4169e1',
                    color: 'white',
                    padding: '8px 12px',
                    border: '3px solid black',
                    fontSize: '14px',
                    fontWeight: '900',
                    textTransform: 'uppercase'
                  }}
                >
                  {clothing}
                </div>
              ))}
            </div>
            <p style={{ fontSize: '12px', marginTop: '8px', color: '#666' }}>
              Stay comfortable in {weatherData.condition.toLowerCase()} conditions
            </p>
          </div>

          <button 
            className="brutal-button yellow"
            style={{ width: '100%', marginTop: '20px', color: 'black' }}
            onClick={generateRecommendations}
          >
            🔄 GENERATE NEW RECOMMENDATIONS
          </button>
        </div>
      )}
    </div>
  );
};

export default AIRecommendations;
